class TestingCoordinator:
    @staticmethod
    def generate_testing_report(results: Dict, agency_ids: List[str]) -> Dict:
        """Generate and send user testing reports to agencies"""
        report = {
            "summary": results.get("summary", ""),
            "findings": results.get("findings", []),
            "recommendations": results.get("recommendations", []),
            "timestamp": datetime.datetime.utcnow()
        }

        for agency_id in agency_ids:
            db.agency_reports.insert_one({
                "agency_id": agency_id,
                "report": report,
                "status": "delivered"
            })

        logging.info(f"Sent testing reports to {len(agency_ids)} agencies")
        return {"status": "success", "reports_sent": len(agency_ids)}

