class FABSAdmin:
    @staticmethod
    def update_publish_status(submission_id: str, new_status: str) -> bool:
        """Update publish status of FABS submissions"""
        valid_statuses = ["draft", "pending", "published", "rejected"]
        if new_status not in valid_statuses:
            raise ValueError(f"Invalid status. Must be one of {valid_statuses}")

        db.submissions.update_one(
            {"_id": submission_id},
            {"$set": {"publish_status": new_status}}
        )
        logging.info(f"Updated submission {submission_id} to status {new_status}")
        return True

