class DataProcessor:
    @staticmethod
    def sync_d1_generation() -> Dict:
        """Synchronize D1 file generation with FPDS updates"""
        last_fpds_update = db.fpds_updates.find_one(sort=[("timestamp", -1)])
        last_d1_generation = db.d1_files.find_one(sort=[("generated_at", -1)])

        if last_fpds_update and (not last_d1_generation or 
                                last_fpds_update["timestamp"] > last_d1_generation["generated_at"]):
            # Generate new D1 files
            d1_data = {"source": "FPDS", "generated_at": datetime.datetime.utcnow()}
            db.d1_files.insert_one(d1_data)
            logging.info("Generated new D1 files from FPDS updates")
            return {"status": "generated", "timestamp": d1_data["generated_at"]}

        logging.info("No new FPDS data - skipping D1 generation")
        return {"status": "skipped"}

