class FlexFieldValidator:
    @staticmethod
    def validate_flex_field_limits(submission_data: Dict) -> Dict:
        """Validate flex field limits in submissions"""
        limits = db.system_limits.find_one({"component": "flex_fields"})
        errors = []

        for field, value in submission_data.get("flex_fields", {}).items():
            field_limit = limits.get(field, {}).get("max_length", 255)
            if len(str(value)) > field_limit:
                errors.append(f"Field {field} exceeds max length of {field_limit}")

        if errors:
            logging.warning(f"Flex field validation failed: {errors}")
            return {"valid": False, "errors": errors}

        logging.info("Flex field validation passed")
        return {"valid": True}

class TestingManager:
    @staticmethod
    def schedule_user_tests(test_plan: Dict) -> str:
        """Schedule user tests and generate summaries"""
        test_id = f"test_{int(time.time())}"
        test_plan["test_id"] = test_id
        test_plan["status"] = "scheduled"
        test_plan["scheduled_at"] = datetime.datetime.utcnow()

        db.user_tests.insert_one(test_plan)
        logging.info(f"Scheduled user test {test_id}")
        return test_id

    @staticmethod
    def generate_test_summary(test_id: str) -> Dict:
        """Generate test summary report"""
        test_data = db.user_tests.find_one({"test_id": test_id})
        if not test_data:
            raise ValueError(f"Test {test_id} not found")

        summary = {
            "test_id": test_id,
            "participants": len(test_data.get("participants", [])),
            "success_rate": test_data.get("success_rate", 0),
            "issues_found": len(test_data.get("issues", [])),
            "generated_at": datetime.datetime.utcnow()
        }

        db.test_summaries.insert_one(summary)
        logging.info(f"Generated summary for test {test_id}")
        return summary

class FABSManager:
    _current_publishes = set()

    @classmethod
    def manage_submission_publishing(cls, submission_id: str) -> bool:
        """Manage submission publishing to prevent concurrent publishes"""
        if submission_id in cls._current_publishes:
            logging.warning(f"Duplicate publish attempt for {submission_id}")
            return False

        cls._current_publishes.add(submission_id)
        try:
            # Simulate publish process
            time.sleep(2)  # Placeholder for actual publish logic
            db.submissions.update_one(
                {"_id": submission_id},
                {"$set": {"publish_status": "published"}}
            )
            logging.info(f"Successfully published submission {submission_id}")
            return True
        finally:
            cls._current_publishes.remove(submission_id)

class EntityValidator:
    @staticmethod
    def validate_ppop_duns(entity_data: Dict) -> Dict:
        """Validate PPOP and DUNS information"""
        errors = []

        # Validate DUNS format
        duns = entity_data.get("duns", "")
        if not duns or not duns.isdigit() or len(duns) != 9:
            errors.append("Invalid DUNS number format")

        # Validate PPOP data
        ppop = entity_data.get("ppop", {})
        required_ppop_fields = ["name", "address", "phone"]
        for field in required_ppop_fields:
            if not ppop.get(field):
                errors.append(f"Missing required PPOP field: {field}")

        if errors:
            logging.warning(f"Entity validation failed: {errors}")
            return {"valid": False, "errors": errors}

        logging.info("Entity validation passed")
        return {"valid": True}

class DataLoader:
    @staticmethod
    def load_historical_data(data_type: str, data: List[Dict]) -> Dict:
        """Load historical FPDS or FABS data"""
        if data_type not in ["FPDS", "FABS"]:
            raise ValueError("Data type must be either FPDS or FABS")

        collection = db[f"historical_{data_type.lower()}"]
        result = collection.insert_many(data)
        logging.info(f"Loaded {len(data)} historical {data_type} records")
        return {"inserted": len(result.inserted_ids)}
